import styles from './style.module.css'

interface ProductProps{
  products: {
    productId: number;
    productName: string;
    productImage: string | null;
    productPrice: number;
    productHasHot?: number | null;
    productHasIce?: number | null;
    productHasLarge?: number | null;
    productHasMedium?: number | null;
    productHasSmall?: number | null;
  }[];
}





export default function MenuItem({products}:ProductProps){

    const className = styles.menuItem

    return(
        <>
        { products.map(Item=>(
        <div className={className}>

          <div>{Item.productName}</div>
        <img src={Item.productImage} alt={Item.productName} />
      <span>{Item.productName}</span>
      <span>{`${Item.productPrice}원`}</span>
      </div>
       ))}
        </>
    );
}
